import React, {useState} from "react"
import axios from "axios"

function Main() {

    const [allThings, setAllThings] = React.useState([]);


    const options = {
        method: 'GET',
        url: 'https://jgentes-crime-data-v1.p.rapidapi.com/crime',
        params: {
          startdate: '9/19/2015',
          enddate: '9/25/2015',
          long: '-122.5076392',
          lat: '37.757815'
        },
        headers: {
          'X-RapidAPI-Key': '3d30d4cbefmshd966c75fd3ed17dp16380djsn1e83dc34d81a',
          'X-RapidAPI-Host': 'jgentes-Crime-Data-v1.p.rapidapi.com'
        }
      };

      axios.request(options).then(function (response) {
          console.log(response.data);
      }).catch(function (error) {
          console.error(error);
      });



    React.useEffect(function () {
        axios
          .get("https://jgentes-crime-data-v1.p.rapidapi.com/crime")
          .then((response) => {
            setAllThings(response.data);
            console.log(response)
          })
          .catch((error) => {
            console.log(error);
          });
      }, []);

    return (
        <div className="mainArea">
            I'm the main component
        </div>

    )
}



export default Main
